-- Volcando estructura para procedimiento dentalcare.listarRecipes
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `listarRecipes`(
in idPac int
)
BEGIN
	select distinct T0.id,idPacientes,count(idPacientes) CantMedicinas,fecha,concat(T1.nombres,' ',T1.apellidos) nombre from recipes T0
    inner join medicos T1 on T0.idMedico = T1.id
    where idPacientes = idPac
    group by T0.id,idPacientes,fecha,T1.nombres,T1.apellidos;
END//
DELIMITER ;

